import Heading from "./Heading";
import { appContext, AppProvider } from "../context/appContext";

const Layout = ({ children }) => {
  return (
    <AppProvider>
      <main className="">
        <Heading />
        {children}
      </main>
    </AppProvider>
  );
};

export default Layout;
